-	while (true)
-	  result.append("    , \"" 
-			+ keys.nextElement().toString() 
-			+ "\",\t\"" 
-			+ values.nextElement().toString()
-			+ "\"\n");
-      }
-    catch (NoSuchElementException ex)
-      {
-      }
-    
-    // Append last element with closing bracket
-    result.append("  };\n}\n");
-    System.out.println(result);
-  }
-}
